import { React, useState, useEffect } from "react";
import { useParams } from "react-router-dom";
import { getById } from "../api/requests";

const Buzz = () => {
  const { id } = useParams();
  const [error, setError] = useState("");
  const [buzz, setBuzz] = useState(null);

  useEffect(() => {
    let reqData = {
      id: id,
    };
    setError("");
    const response = (data) => {
      if (data["error"]) {
        setError(data["error"]);
      } else {
        console.log(data);
        setBuzz(data);
      }
    };
    getById(reqData, response);
  }, []);

  return <div>{}</div>;
};

export default Buzz;
